char scanSenzaInvio()

{
    char tasto_premuto;

    system("/bin/stty raw");

    tasto_premuto = getchar();

    system("/bin/stty cooked");

    return tasto_premuto;
}

void UnSecondo ()

{
    clock_t start, a;
    start = clock();
    a = clock();
    while ((a - start) % CLOCKS_PER_SEC != 0){a = clock();}
    return ;
}





