Specifiche_Casella Risp1Coord (Mappa_Inizializzata * Mappa_Interattiva)

{

    Specifiche_Casella Punto_Indicato;

    char Coordinate_User[25];

    int riga, colonna, i, h;

ERR_R_1_C:

    printf("\nInserisci le coordinate (ATTENZIONE ALLE MAIUSCOLE!):\n\n     Esempio di inserimento corretto:                                M rosso 6 bianco             \n\n");

    i = 0;

    Coordinate_User[0] = 'a';

    while (Coordinate_User[i] != '\n') {
        if (i != 0)

        {i = i + 1;}

        scanf("%c", &Coordinate_User[i]);

        if (i == 0) {i = i + 1;}

    }

    Coordinate_User[i] = '\0';

    h = 0;

    for (i = 2; Coordinate_User[i] != '\0'; i = i + 1)

    {
        if (Coordinate_User[i] != ' ') {Coordinate_User[h] = Coordinate_User[i]; h = h + 1;}
    }

    Coordinate_User[h] = '\0';

    i = 1;

    for (riga = 0; riga < 67 && i != 0; riga = riga + 1)

    {
        for (colonna = 0; colonna < 83 && i != 0; colonna = colonna + 1)

        {
            i = strcmp(Coordinate_User, Mappa_Interattiva->Mappa[riga][colonna].Coordinate);
        }
    }

    if  (i != 0) {printf("\nCoordinate NON corrette\n\n\n\n\n\nINSERISCINE DI CORRETTE:\n"); for (i = 0; i < 25; i = i + 1) {Coordinate_User[i] = '\0';} goto ERR_R_1_C;}

    Punto_Indicato = Mappa_Interattiva->Mappa[riga - 1][colonna - 1];

    return Punto_Indicato;

}

Specifiche_Casella Risp2Coord (Mappa_Inizializzata * Mappa_Interattiva)

{
    Specifiche_Casella Punto_Indicato;

    char CharID_User;

    int riga, colonna, i;

ERR_R_2_C:

    printf("\nIndica il Numero o la Lettera che identifica la Citta/Localita in cui ti trovi:");

    TestoRisp2();

    scanf("\n\n%c", &CharID_User);

    i = 1;

    for (riga = 0; riga < 67 && i != 0; riga = riga + 1)

    {
        for (colonna = 0; colonna < 83 && i != 0; colonna = colonna + 1)

        {
            if (Mappa_Interattiva->Mappa[riga][colonna].CharID == CharID_User || Mappa_Interattiva->Mappa[riga][colonna].CharID == (CharID_User - 'a' + 'a')) {i = 0;}
        }
    }

    if  (i != 0) {printf("\nIl carattere indicato NON identifica nessuna Citta/Localita\n\n\n\n\n\nInseriscine uno corretto:\n"); CharID_User = '\0'; goto ERR_R_2_C;}

    Punto_Indicato = Mappa_Interattiva->Mappa[riga - 1][colonna - 1];

    return Punto_Indicato;

}


void StampaMappa (Mappa_Inizializzata * Mappa_Interattiva)

{
    int riga, colonna, i;

    char h;

    printf("\n ");

    h = 65;

    for (i = 0; i < 83; i = i + 1) {
        printf("%c ", h);
        h = h + 1;
        if (i == 25 || i == 51 || i == 77) {h = 65;}
    }

    printf("\n1");

    h = 2;

    for (riga = 0; riga < 67; riga = riga + 1)

    {
        for (colonna = 0; colonna < 83; colonna = colonna + 1)

        {
            if (Mappa_Interattiva->Mappa[riga][colonna].terra_mare_costa != 'm' && Mappa_Interattiva->Mappa[riga][colonna].CharID == '?') {printf("# ");}

            else
                if (Mappa_Interattiva->Mappa[riga][colonna].CharID != '?') {printf("%c ", Mappa_Interattiva->Mappa[riga][colonna].CharID);}
                else printf("  ");

        }

        if (riga != 66) {
            printf("\n%d", h);
            h = h + 1;
            if (h == 10) {h = 1;}
        }

    }
}

void StampaMappaPosizionamento (Mappa_Inizializzata * Mappa_Interattiva, Specifiche_Casella * posizione_corrente)

{
    int riga, colonna, i;

    char h;

    printf("\n ");

    h = 65;

    for (i = 0; i < 83; i = i + 1) {
        printf("%c ", h);
        h = h + 1;
        if (i == 25 || i == 51 || i == 77) {h = 65;}
    }

    printf("\n1");

    h = 2;

    for (riga = 0; riga < 67; riga = riga + 1)

    {
        for (colonna = 0; colonna < 83; colonna = colonna + 1)

        {
            if (Mappa_Interattiva->Mappa[riga][colonna].x_colonna == posizione_corrente->x_colonna && Mappa_Interattiva->Mappa[riga][colonna].y_riga == posizione_corrente->y_riga) {printf("+ ");}
            else
                if (Mappa_Interattiva->Mappa[riga][colonna].terra_mare_costa != 'm' && Mappa_Interattiva->Mappa[riga][colonna].CharID == '?') {printf("# ");}
                else
                    if (Mappa_Interattiva->Mappa[riga][colonna].CharID != '?') {printf("%c ", Mappa_Interattiva->Mappa[riga][colonna].CharID);}
                    else printf("  ");

        }
        if (riga != 66) {
            printf("\n%d", h);
            h = h + 1;
            if (h == 10) {h = 1;}
        }

    }

}

